import { data } from 'jquery';
import React from 'react';

export default function Weather() {

    let weatherData;

    fetch('https://api.openweathermap.org/data/2.5/weather?lat=43.700111&lon=-79.416298&appid=57a0a94dc910ede17013fdbebbdb242c')  

        .then(function(resp) { return resp.json() }) // Convert data to json
        .then(function(data) {
        //console.log(data);
        weatherData = data;
        weatherData.temp = data.main.temp;
        console.log(data.main.temp);
  })
    .catch(function() {
    // catch any errors
  });

    return(

        <div>
            <h2>Looks like good weather for Connect-4 in Chapel Hill!</h2>
            <h2>Temp: {weatherData.main.temp}</h2>
            {/* <subtitle>Humidity: {weatherData.main.humidity}</subtitle>
            <subtitle>Conditions: {weatherData.main.weather.main}</subtitle> */}
        </div>
  );
}
